                    .CODE                                                 
MAIN                PROC FAR      



                    MOV AH,0
                    MOV AL,13H
                    INT 10H
                    
                    ASSUME DS:DATA6
                    MOV AX , DATA6
                    MOV DS , AX
                    MOV SI, OFFSET BACKGROUND
                    DRAW_OBJECT 200,320,0,0

                    ASSUME DS:DATA4
                    MOV AX , DATA4
                    MOV DS , AX
                    
                    CHECKMENUE:
                    MOV AH, 1
                    INT 16H
                    JNZ F1LABEL

                    F1LABEL:
                    ;{ TAKE THE USER INPUT FROM THE KEYBOARD BUFFER
                        MOV    AH, 0
                        INT    16H      
                        CALL   CLEARKEYBOARDBUFFER  
                    ;} 
                     CMP AH, 3BH 
                     JNE F2LABEL
                     CALL PLAYER1INFO
                     JMP START
                    
                    F2LABEL:
                     CMP AH, 3CH 
                     JNE CHECKMENUE
                     CALL PLAYER2INFO
                     JMP START

                    START:
                        ASSUME DS:DATA4
                        MOV AX , DATA4
                        MOV DS , AX
                      ;{ OPEN VEDIO MODE
                        MOV     AX, 4F02H
                        MOV     BX, 105H
                        INT     10H
                    ;}
                    CALL DRAWCHIKENS

                    ; ASSUME DS:DATA8
                    ; MOV AX , DATA8
                    ; MOV DS , AX
                    ; ASSUME DS:DATA9
                    ; MOV AX , DATA9
                    ; MOV DS , AX
                    ; MOV SI, OFFSET MCQMEDIAM1
                    ; DRAW_OBJECT 250,250,754,138
                    ; ASSUME DS:DATA4
                    ; MOV AX , DATA4
                    ; MOV DS , AX

                CALL DRAWPLAYER

                MAINLOOP:                          
              ;{ DELAY 0.125 SECOND  WHERE DELAY IN MELLISECOND IS CXDX  CX AND MSB AND DX AS LSB
                     MOV     CX, 00H
                     MOV     DX, 0C300H
                     MOV     AH, 86H
                     INT     15H
               ;}
               CALL UPDATEDATA
               MOV AH, 1
               INT 16H
               JZ MAINLOOP    
               ;{
                    CALL USERINPUT
                    JMP MAINLOOP
                ;}
                    MOV AH,4CH
                    INT 21H
MAIN                ENDP  

;------------------------------------------------------------------------
; CLEARS KEYBOARD BUFFER
;--------------------------------------------------------------------------
CLEARKEYBOARDBUFFER     PROC    NEAR
;{
    PUSH        AX
    PUSH        ES
    MOV     AX, 0000H
    MOV     ES, AX
    MOV     ES:[041AH], 041EH
    MOV     ES:[041CH], 041EH               ; CLEARS KEYBOARD BUFFER
    POP     ES
    POP     AX
    RETN
;}
CLEARKEYBOARDBUFFER     ENDP

PLAYER1INFO             PROC   NEAR
;{
    MOV CHOSSEDPLAYER,1
    MOV DX,BULET2STARTPOSY
    MOV BULETSTARTPOSY,DX
    MOV DX,BULET2STARTPOSX
    MOV BULETSTARTPOSX,DX
    MOV DX,BULET2MHEIGHT
    MOV BULETHEIGHT,DX
    MOV DX,BULET2MWEDTH
    MOV BULETWEDTH,DX
RETN
;}
PLAYER1INFO              ENDP

PLAYER2INFO             PROC   NEAR
;{
    MOV CHOSSEDPLAYER,2
    MOV DX,BULET1STARTPOSY
    MOV BULETSTARTPOSY,DX
    MOV DX,BULET1STARTPOSX
    MOV BULETSTARTPOSX,DX
    MOV DX,BULET1MHEIGHT
    MOV BULETHEIGHT,DX
    MOV DX,BULET1MWEDTH
    MOV BULETWEDTH,DX
RETN
;}
PLAYER2INFO              ENDP


UPDATEDATA              PROC   NEAR
;{
CMP BULETEXIST,1
JNE UPDATED
CLEAR BULETHEIGHT,BULETWEDTH,BULETSTARTPOSX,BULETSTARTPOSY
SUB BULETSTARTPOSY,2
CMP BULETSTARTPOSY, 138
JLE COLIDE
CALL DRAWBULET
JMP UPDATED
COLIDE:
MOV BULETEXIST,0

CMP CHOSSEDPLAYER, 1
JNE BU2
CALL PLAYER1INFO
JMP UPDATED
BU2:
CALL PLAYER2INFO
UPDATED:
RETN
;}
UPDATEDATA              ENDP


USERINPUT               PROC   NEAR
;{
    ;{
        MOV AH, 0
        INT 16H 
        CALL CLEARKEYBOARDBUFFER  
    ;}
    MOVELEFT:
        CMP AH, 4BH 
        JNE MOVERIGHT
        CMP PLAYSTARTPOSX,10
        JLE SKIP1
        CLEAR PLAYERMHEIGHT,PLAYERMWEDTH,PLAYSTARTPOSX,PLAYSTARTPOSY
        SUB PLAYSTARTPOSX, 3
        SUB BULETSTARTPOSX, 3
        SUB BULET1STARTPOSX, 3
        SUB BULET2STARTPOSX, 3
        CALL DRAWPLAYER
    JMP EXIT
    
    SKIP1:
    JMP EXIT
    
    MOVERIGHT:
        CMP AH, 4DH 
        JNE FIRE
        CMP PLAYSTARTPOSX,879
        JGE EXIT
        CLEAR PLAYERMHEIGHT,PLAYERMWEDTH,PLAYSTARTPOSX,PLAYSTARTPOSY
        ADD PLAYSTARTPOSX, 3
        ADD BULETSTARTPOSX, 3
        ADD BULET2STARTPOSX, 3
        ADD BULET1STARTPOSX, 3
        CALL DRAWPLAYER
    FIRE:  
        CMP AL, 20H
        JNE EXIT
        CMP BULETEXIST, 0
        JNE EXIT
        MOV BULETEXIST, 1
        CALL DRAWBULET    
    EXIT:
RETN
;}
USERINPUT       ENDP


DRAWBULET             PROC  NEAR
;{
    CMP CHOSSEDPLAYER, 1
    JNE PLAYER2CHOSEN
    MOV SI, OFFSET BULET2
    JMP DRAWB
    PLAYER2CHOSEN:
    MOV SI, OFFSET BULET1
    DRAWB:
    DRAW_OBJECT BULETHEIGHT,BULETWEDTH,BULETSTARTPOSX,BULETSTARTPOSY
RETN
;}
DRAWBULET       ENDP
DRAWPLAYER            PROC  NEAR
;{
CMP CHOSSEDPLAYER,1
JNE P2
CALL DRAWPLAYER1
JMP P1
P2:
CALL DRAWPLAYER2
P1:
RETN
;}
DRAWPLAYER       ENDP


DRAWCHIKENS           PROC  NEAR
;{
  RANDOMLOOP:  
  CMP CHIKENDRAWN,0
  JNE CON1
  RETN
  CON1:
  RANDOMIZE 1, 7, RANDOMIZEDCHIKEN, RANDSEED  
  CMP RANDOMIZEDCHIKEN,1
  JNE BLUECHIKEN
  CMP BOSSMODELDRAWEN,1
  JNE RANDOMLOOP
  CALL DRAWBOSSMODEL
  DEC BOSSMODELDRAWEN
  JMP RANDOMLOOP
  
  BLUECHIKEN:
  
  CMP RANDOMIZEDCHIKEN,2
  JNE MAGENTICCHIKEN
  CMP BLUEMODELDRAWEN,1
  JNE RANDOMLOOP
  CALL DRAWBLUEMODEL
  DEC BLUEMODELDRAWEN
  JMP RANDOMLOOP

  MAGENTICCHIKEN:
  CMP RANDOMIZEDCHIKEN,3
  JNE SWEATERCHIKEN
  CMP MAGNETICMODELDRAWEN,1
  JNE RANDOMLOOP
  CALL DRAWMAGNETICMODEL
  DEC MAGNETICMODELDRAWEN
  JMP RANDOMLOOP

  JMP CON0
  SKIP0:
  JMP RANDOMLOOP
  CON0:
  SWEATERCHIKEN:
  CMP RANDOMIZEDCHIKEN,4
  JNE REDCHIKEN
  CMP SWEATERMODELDRAWEN,1
  JNE SKIP0
  CALL DRAWSWEATERMODEL
  DEC SWEATERMODELDRAWEN
  JMP SKIP0

  REDCHIKEN:
  CMP RANDOMIZEDCHIKEN,5
  JNE MILITARYCHIKEN
  CMP REDMODELDRAWEN,1
  JNE SKIP0
  CALL DRAWREDMODEL
  DEC REDMODELDRAWEN
  JMP SKIP0

  MILITARYCHIKEN:
  CMP RANDOMIZEDCHIKEN,6
  JNE PARTYCHIKEN
  CMP MILITARYMODELDRAWEN,1
  JNE SKIP0
  CALL DRAWMILITARYMODEL
  DEC MILITARYMODELDRAWEN
  JMP SKIP0

  PARTYCHIKEN:
  CMP PARTYMODELDRAWEN,1
  JNE SKIP0
  CALL DRAWPARTYCHIKEN
  DEC PARTYMODELDRAWEN
  JMP SKIP0
;}
DRAWCHIKENS           ENDP  



DRAWPARTYCHIKEN       PROC    NEAR
;{
    MOV BX,CHIKENWEDTH
    MOV CX,CHIKENHEIGHT
    MOV DI,STARTPOSX
    MOV DX,STARTPOSY
    ASSUME DS:DATA1
    MOV AX , DATA1
    MOV DS , AX
    MOV CHIKENWEDTH1,BX
