    ASSUME DS:DATA4
    MOV AX , DATA4
    MOV DS , AX
    DEC CHIKENDRAWN
    MOV AX, CHIKENWEDTH
    ADD STARTPOSX, AX
    MOV AX, STARTPOSX
    MOV AX,STARTPOSX
    MOV AX,MARGEN
    ADD STARTPOSX,AX  
    RETN
 ;}
